export const signin = (reference_id, user_information) => {
  return {
    type: "SIGN_IN",
    reference_id,
    user_information,
  };
};

export const signout = () => {
  return {
    type: "SIGN_OUT",
  };
};

export const save_homepage_content = () => {
  return {
    type: "SAVE_HOMEPAGE_CONTENT",
  };
};

export const delete_homepage_content = () => {
  return {
    type: "DELETE_HOMEPAGE_CONTENT",
  };
};
